import React, { useEffect } from 'react';
import NavBar from '../components/Navbar/NavBar';
import Footer from '../components/Footer';

const ConsultationComponent = () => {
    useEffect(() => {
        // Load the Calendly script
        const script = document.createElement('script');
        script.src = "https://assets.calendly.com/assets/external/widget.js";
        script.async = true;
        document.body.appendChild(script);

        // Cleanup script on component unmount
        return () => {
            document.body.removeChild(script);
        };
    }, []);

    return (
        <>
            <div>
                <NavBar />
            </div>
            <div className="max-w-4xl mx-auto p-8 flex flex-col h-screen">

                <div className="flex-grow flex flex-col items-center justify-center space-y-8">
                    <h1 className="text-3xl font-bold">Book Your Consultation</h1>
                    <div
                        className="calendly-inline-widget"
                        data-url="https://calendly.com/p218055-pwr/30min?primary_color=000000"
                        style={{ width: '400px', height: '900px', overflow: 'hidden' }} // Fixed size
                    ></div>
                </div>
                <Footer />
            </div>
        </>
    );
};

export default ConsultationComponent;
